import "./Banner.css";
export default function Banner() {
  return (
    <div className="banner">
      <div>
        <p>Pro.Beyond</p>
        <h1>iphone 14 Pro</h1>
        <p>Created to change everything for the better. For everyone</p>
      </div>
    </div>
  );
}
